body {
    margin: 0;
    padding: 0;
    background-color: gray;

    #loginForm {
        background-color: #fff;
        border-radius: 10px;
        padding: 50px;
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
            header {
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;

                    h2 {
                        font-size: 2em;
                    }

                    .header_logo img {
                        width: 150px;
                        height: 50px;
                        margin-bottom: 40px;
                    }
            }

            main {
                display: flex;
                flex-direction: column;
                align-items: center;
                form {
                    input {
                        margin-bottom: 20px;
                    }
                }
                button {
                    width: 100%;
                    border-radius: 15px;
                }
            }
    }

}
